  `UpTime` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `DateTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '兑换时间',
  PRIMARY KEY (`Id`),
  KEY `DateTimes` (`DateTime`,`Status`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;

